import axios from "axios";
import movieDetails from "../models/movieDetails";

const removeFavourite = (movie : movieDetails) => {
    return axios.delete<movieDetails>(`${process.env.REACT_APP_BASE_URL}/favourite`,
    {
        headers : {
            'Content-type' : 'application/json'
        }
    , data : {
        source : movie
    }}
    );
};

export default removeFavourite;
